import React from 'react';
import './Modal.css'

const About = () => {
    return(

        <div 
            className = "ui raised very padded text container segment"
            style = {{marginTop: "80px"}}
        >
            <h3 className = "ui header">About</h3>
            <p>Morbi sed enim porttitor, varius eros nec, egestas mauris. Morbi luctus turpis ac volutpat elementum. In nec turpis sed felis iaculis pretium vel eget elit. Vivamus dignissim non metus dignissim fermentum. Suspendisse sagittis tincidunt massa, eget sodales ante rhoncus et. Quisque egestas turpis turpis, ac tempus enim consectetur eu. Maecenas nisl neque, vulputate blandit vestibulum pretium, dictum vehicula orci. Nunc a tempor turpis, ut pulvinar neque. Sed feugiat nisi sed neque pulvinar volutpat. Morbi vitae est sodales, dignissim arcu non, feugiat magna. Praesent eu nulla at turpis lacinia suscipit. Nullam non nulla convallis, gravida ex vel, suscipit turpis.</p>

        </div>

    )
}

export default About;
